import React from 'react';
import _ from 'lodash';
import Drawer from 'material-ui/Drawer';
import Logo from './Logo';
import { List, ListItem } from 'material-ui/List';
import Subheader from 'material-ui/Subheader';
import Divider from 'material-ui/Divider';
import AlbumItem from './AlbumItem';

const propTypes = {
  structure: React.PropTypes.array,
  activeAlbumId: React.PropTypes.string,
  clickMenu: React.PropTypes.func,
  isDocked: React.PropTypes.bool,
  isOpened: React.PropTypes.bool,
  controlMenuOpen: React.PropTypes.func,
};

class MenuBox extends React.Component {
  constructor(props, context) {
    super(props, context);

    this.handleClick = this.handleClick.bind(this);
    this.handleReqChg = this.handleReqChg.bind(this);
  }

  handleClick(albumId) {
    this.props.clickMenu(albumId);
    this.props.controlMenuOpen(false);
  }

  handleReqChg(open) {
    this.props.controlMenuOpen(open);
  }

  render() {
    const nodes = [];
    const styles = {
      sidemenu: {
        backgroundColor: '#1812A8',
      },
      divider: {
        backgroundColor: 'rgba(255, 255, 255, 0.15)',
      },
      subheader: {
        display: 'flex',
        justifyContent: 'space-between',
        paddingRight: 16,
      },
      listitem: {
        // click on padding area will be missed.
        padding: '0',
      },
    };
    nodes.push(<Divider key={'top-divi'} style={styles.divider} />);
    nodes.push(<a key={'top-a'} href="/about.html">このサイトについて・利用規約</a>);
    _.each(this.props.structure, (grp) => {
      let grpCnt = '';
      if (grp.group_id === 'albums') {
        grpCnt = grp.group_count;
      }
      nodes.push(<Divider key={`divi-${grp.group_id}`} style={styles.divider} />);
      nodes.push(
        <Subheader key={grp.group_id} style={styles.subheader}>
          <span>{grp.group_id}</span>
          <span>{grpCnt}</span>
        </Subheader>
      );
      _.each(grp.listset, (album) => {
        const isActive = album.id === this.props.activeAlbumId;
        let activeStyle = {};
        if (isActive) {
          activeStyle = { backgroundColor: '#3a34ea' };
        }
        nodes.push(
          <ListItem
            key={`${grp.group_id}-${album.id}`}
            style={activeStyle}
            innerDivStyle={styles.listitem}
          >
            <AlbumItem
              key={`${grp.group_id}${album.id}`}
              album={album}
              select={this.handleClick}
            />
          </ListItem>
        );
      });
    });
    return (
      <Drawer
        open={this.props.isOpened}
        docked={this.props.isDocked}
        onRequestChange={this.handleReqChg}
      >
        <Logo />
        <List style={styles.sidemenu}>
          {nodes}
        </List>
      </Drawer>
    );
  }
}

MenuBox.propTypes = propTypes;

export default MenuBox;

import React from 'react';
import Sound from 'react-sound';
import Drawer from 'material-ui/Drawer';
import AppBar from 'material-ui/AppBar';
import IconButton from 'material-ui/IconButton';
import Avatar from 'material-ui/Avatar';
import RaisedButton from 'material-ui/RaisedButton';
import SoundPlayer from './SoundPlayer';
import FileDownload from 'material-ui/svg-icons/file/file-download';
import PlayArrow from 'material-ui/svg-icons/av/play-arrow';
import Pause from 'material-ui/svg-icons/av/pause';

const propTypes = {
  track: React.PropTypes.object,
  status: React.PropTypes.string,
  controlPlayStatus: React.PropTypes.func,
  playingId: React.PropTypes.string,
  isDocked: React.PropTypes.bool,
  isOpened: React.PropTypes.bool,
  controlDrawerOpen: React.PropTypes.func,
};

class RightDrawer extends React.Component {
  constructor(props, context) {
    super(props, context);

    this.handlePlay = this.handlePlay.bind(this);
    this.handlePause = this.handlePause.bind(this);
    this.handleReqChg = this.handleReqChg.bind(this);
    this.handleDownload = this.handleDownload.bind(this);
  }

  handlePlay() {
    this.props.controlPlayStatus(Sound.status.PLAYING);
  }

  handlePause() {
    this.props.controlPlayStatus(Sound.status.PAUSED);
  }

  handleReqChg(open) {
    this.props.controlDrawerOpen(open);
  }

  handleDownload() {
    this.props.controlPlayStatus(Sound.status.PAUSED);
  }

  render() {
    const styles = {
      appbar: {
        backgroundColor: 'rgb(7, 5, 98)',
      },
      drawer: {
        backgroundColor: 'rgba(32, 32, 45, 0.9)',
      },
      commentHead: {
        display: 'flex',
        alignItems: 'center',
        padding: '0 16px',
      },
      commentAvatar: {
        marginRight: '16px',
      },
      commentText: {
        marginTop: '0',
        padding: '16px',
        lineHeight: '1.4',
        fontSize: '14px',
      },
      download: {
        display: 'flex',
        justifyContent: 'center',
      },
    };
    let iel = (
      <IconButton onClick={this.handlePlay}><PlayArrow /></IconButton>
    );
    if (this.props.playingId === this.props.track.id
        && this.props.status === Sound.status.PLAYING) {
      iel = (
        <IconButton onClick={this.handlePause}><Pause /></IconButton>
      );
    }
    return (
      <Drawer
        width={300}
        openSecondary
        open={this.props.isOpened}
        containerStyle={styles.drawer}
        docked={this.props.isDocked}
        onRequestChange={this.handleReqChg}
      >
        <AppBar
          title={this.props.track.title}
          iconElementLeft={iel}
          style={styles.appbar}
          titleStyle={{ color: '#fff' }}
        />
        <SoundPlayer
          track={this.props.track}
          status={this.props.status}
          controlPlayStatus={this.props.controlPlayStatus}
        />
        <div>
          <div style={styles.commentHead}>
            <Avatar src="/assets/img/mojiro.jpg" style={styles.commentAvatar} />
            <span>{'ANDY\'s comment:'}</span>
          </div>
          <p style={styles.commentText}>{this.props.track.desc}</p>
        </div>
        <div style={styles.download}>
          <RaisedButton
            label="ダウンロード"
            href={`/download/${this.props.track.id}.html`}
            secondary
            style={styles.button}
            icon={<FileDownload />}
            target="_blank"
            disabled={!this.props.track.id}
            onTouchTap={this.handleDownload}
          />
        </div>
      </Drawer>
    );
  }
}

RightDrawer.propTypes = propTypes;

export default RightDrawer;

import React from 'react';
import Sound from 'react-sound';
import Slider from 'material-ui/Slider';
import Popover from 'material-ui/Popover';
import FlatButton from 'material-ui/FlatButton';
import VolumeUp from 'material-ui/svg-icons/av/volume-up';

const propTypes = {
  track: React.PropTypes.object,
  status: React.PropTypes.string,
  controlPlayStatus: React.PropTypes.func,
};

class SoundPlayer extends React.Component {
  constructor(props, context) {
    super(props, context);

    this.handleSongPlaying = this.handleSongPlaying.bind(this);
    this.handleSliderChange = this.handleSliderChange.bind(this);
    this.handlePopover = this.handlePopover.bind(this);
    this.handleRequestClose = this.handleRequestClose.bind(this);
    this.handleVolume = this.handleVolume.bind(this);
    this.calcElapse = this.calcElapse.bind(this);
    this.calcRemain = this.calcRemain.bind(this);

    this.state = {
      status: Sound.status.STOPPED,
      ing: {},
      fromPosition: 0,
      duration: 0,
      progress: 0,
      volumeOpen: false,
      volume: 0.75,
    };
  }

  handleSongPlaying(ing) {
    // console.log(`★ ${a.position} / ${a.duration}`);
    this.setState({
      ing,
      duration: ing.duration,
      progress: ing.position / ing.duration,
    });
  }

  handleSliderChange(event, rate) {
    this.setState({ fromPosition: rate * this.state.duration });
  }

  handlePopover(event) {
    event.preventDefault();
    this.setState({
      volumeOpen: !this.state.volumeOpen,
      anchorEl: event.currentTarget,
    });
  }

  handleRequestClose() {
    this.setState({
      volumeOpen: false,
    });
  }

  handleVolume(event, vol) {
    this.setState({ volume: vol });
  }

  formatTime(millisec) {
    if (isNaN(millisec) || millisec < 0) {
      return '--:--';
    }
    const all = Math.floor(millisec / 1000);
    const sec = all % 60;
    const min = (all - sec) / 60;
    const sec00 = `00${sec}`.slice(-2);
    return `${min}:${sec00}`;
  }

  calcElapse() {
    return this.formatTime(this.state.ing.position);
  }

  calcRemain() {
    const rem = this.state.duration - this.state.ing.position;
    return `-${this.formatTime(rem)}`;
  }

  render() {
    const elapse = this.calcElapse();
    const remain = this.calcRemain();
    const styles = {
      current: {
        padding: '16px',
      },
      elarem: {
        display: 'flex',
        justifyContent: 'space-between',
      },
      slider: {
        margin: '6px 0',
      },
      subCtrl: {
        display: 'flex',
        justifyContent: 'flex-end',
      },
      popover: {
        padding: '10px',
      },
    };
    return (
      <div>
        <Sound
          url={`http://oto-no-sono.com${this.props.track.filepath}`}
          playStatus={this.props.status}
          playFromPosition={this.state.fromPosition}
          onLoading={this.handleSongLoading}
          onPlaying={this.handleSongPlaying}
          onFinishedPlaying={this.handleSongFinishedPlaying}
          volume={this.state.volume * 100}
        />
        <div style={styles.current}>
          <div style={styles.elarem}>
            <span>{elapse}</span>
            <span>{remain}</span>
          </div>
          <Slider
            value={this.state.progress}
            onChange={this.handleSliderChange}
            sliderStyle={styles.slider}
          />
        </div>
        <div style={styles.subCtrl}>
          <FlatButton
            onTouchTap={this.handlePopover}
            label="Volume"
            icon={<VolumeUp />}
          />
        </div>
        <Popover
          open={this.state.volumeOpen}
          anchorEl={this.state.anchorEl}
          anchorOrigin={{ horizontal: 'left', vertical: 'bottom' }}
          targetOrigin={{ horizontal: 'left', vertical: 'top' }}
          onRequestClose={this.handleRequestClose}
          style={styles.popover}
        >
          <Slider
            style={{ height: 100 }}
            axis="y"
            defaultValue={this.state.volume}
            onChange={this.handleVolume}
          />
        </Popover>
      </div>
    );
  }
}

SoundPlayer.propTypes = propTypes;

export default SoundPlayer;

import React from 'react';
import _ from 'lodash';
import Sound from 'react-sound';
import { List, ListItem } from 'material-ui/List';
import TrackItem from './TrackItem';

const propTypes = {
  setId: React.PropTypes.string,
  album: React.PropTypes.object,
  select: React.PropTypes.func,
  playingId: React.PropTypes.string,
  status: React.PropTypes.string,
};

class TrackBox extends React.Component {
  constructor(props, context) {
    super(props, context);

    this.handleClick = this.handleClick.bind(this);
  }

  handleClick(track) {
    this.props.select(track);
  }

  render() {
    const tracks = this.props.album.tracks;
    const styles = {
      listitem: {
        // click on padding area will be missed.
        padding: '0',
      },
      dummy: {
        height: 64 - 8,
      },
    };
    let nodes = [];
    nodes.push(<div key={'dummy'} style={styles.dummy}></div>);
    _.each(tracks, (t) => {
      const isSelected = (t.id === this.props.playingId);
      const isPlaying = isSelected && (this.props.status === Sound.status.PLAYING);
      nodes.push(
        <ListItem key={t.id} innerDivStyle={styles.listitem}>
          <TrackItem
            track={t}
            select={this.handleClick}
            isPlaying={isPlaying}
          />
        </ListItem>
      );
    });
    return (
      <List>
        {nodes}
      </List>
    );
  }
}

TrackBox.propTypes = propTypes;

export default TrackBox;

import React from 'react';
import _ from 'lodash';
import FloatingActionButton from 'material-ui/FloatingActionButton';
import PlayArrow from 'material-ui/svg-icons/av/play-arrow';
import Pause from 'material-ui/svg-icons/av/pause';
import Chip from 'material-ui/Chip';

const propTypes = {
  track: React.PropTypes.object,
  select: React.PropTypes.func,
  isPlaying: React.PropTypes.bool,
};

class TrackItem extends React.Component {
  constructor(props, context) {
    super(props, context);

    this.handleClick = this.handleClick.bind(this);
  }

  handleClick() {
    this.props.select(this.props.track);
  }

  render() {
    const t = this.props.track;
    const styles = {
      wrap: {
        display: 'flex',
        alignItems: 'center',
        padding: '16px',
      },
      trackinfo: {
        flexGrow: '1',
        paddingLeft: '1em',
      },
      title: {
        margin: '8px 0 12px',
      },
      tags: {
        display: 'flex',
      },
      chip: {
        marginRight: '6px',
      },
      chipInner: {
        fontSize: '12px',
        lineHeight: '24px',
      },
    };
    let tags = [];
    _.each(t.tags, (tag) => {
      tags.push(
        <Chip key={tag} style={styles.chip} labelStyle={styles.chipInner}>
          {tag}
        </Chip>
      );
    });
    let fabIcon = this.props.isPlaying ? <Pause /> : <PlayArrow />;
    let playingClass = this.props.isPlaying ? 'playing' : '';
    return (
      <div className={playingClass} onClick={this.handleClick} style={styles.wrap}>
        <FloatingActionButton
          mini
          className={'fab'}
          onClick={this.handleClick}
        >
          {fabIcon}
        </FloatingActionButton>
        <div style={styles.trackinfo}>
          <h3 style={styles.title}>{t.title}</h3>
          <div style={styles.tags}>
            {tags}
          </div>
        </div>
      </div>
    );
  }
}

TrackItem.propTypes = propTypes;

export default TrackItem;

import {
  grey600,
  pinkA100, pinkA200, pinkA400,
  fullWhite,
} from 'material-ui/styles/colors';
import { fade } from 'material-ui/utils/colorManipulator';
import spacing from 'material-ui/styles/spacing';

export default {
  spacing,
  fontFamily: 'Roboto, sans-serif',
  palette: {
    primary1Color: '#070562',
    primary2Color: '#69c3ef',
    primary3Color: grey600,
    accent1Color: pinkA200,
    accent2Color: pinkA400,
    accent3Color: pinkA100,
    textColor: fullWhite,
    secondaryTextColor: fade(fullWhite, 0.7),
    alternateTextColor: '#303030',
    canvasColor: '#303030',
    borderColor: fade(fullWhite, 0.3),
    disabledColor: fade(fullWhite, 0.3),
    pickerHeaderColor: fade(fullWhite, 0.12),
    clockCircleColor: fade(fullWhite, 0.12),
  },
  appBar: {
    textColor: fullWhite,
  },
  floatingActionButton: {
    color: '#69c3ef',
  },
  slider: {
    trackColorSelected: grey600,
    selectionColor: '#69c3ef',
    rippleColor: '#69c3ef',
  },
};

'use strict';

var utils = require('./../utils');
var settle = require('./../core/settle');
var buildURL = require('./../helpers/buildURL');
var parseHeaders = require('./../helpers/parseHeaders');
var isURLSameOrigin = require('./../helpers/isURLSameOrigin');
